import Activity from './Activity';
import { FuseLoadable } from '@fuse';


export const ActivityConfig = {
  settings: {
    layout: {
      config: {}
    }
  },
  routes: [
    {
      path: '/activity',
      component: Activity
    },
    // {
    //   path: '/',
    //   component: Activity
    // },
    {
      path: '/',
      exact: true,
      component: FuseLoadable({
        loader: () => import('./Activity')
      })
    },
  ]
};

/**
 * Lazy load Activity
